    data: |
      SELECT DISTINCT + col2 AS col0, CAST ( + col0 AS INTEGER ) + + - ( - + ( - col2 ) ) FROM tab0 (FORMAT parquet) cor0 WHERE NOT + col0 * 60 IS NOT NULL;
  - name: tab0

outputs:
  - name: q11547.out
    data: |
